import { computed } from 'vue';
import { useStore } from 'vuex'; // Импортируем useStore для доступа к хранилищу

export default {
  __name: 'HomePage',
  setup(__props, {
    expose
  }) {
    expose();
    const store = useStore(); // Получаем доступ к хранилищу Vuex

    // Используем computed для получения значений из хранилища
    const userRole = computed(() => store.getters.getUserRole);
    const userId = computed(() => store.getters.getUserId);
    console.log('UserRole:', userRole.value); // Проверка
    console.log('UserId:', userId.value); // Проверка

    const __returned__ = {
      store,
      userRole,
      userId,
      computed,
      get useStore() {
        return useStore;
      }
    };
    Object.defineProperty(__returned__, '__isScriptSetup', {
      enumerable: false,
      value: true
    });
    return __returned__;
  }
};
